def maxLoss(pricelist):
    if (len(pricelist) <= 1): return 0
    maxIndex = maxVal = minVal = 0
    for i in range(0, len(pricelist)):
        if (pricelist[i] > maxVal): 
            maxVal = pricelist[i]
            maxIndex = i
            
    minVal = maxVal
    
    for j in range(maxIndex, len(pricelist)):
        if (pricelist[j] < minVal):
            minVal = pricelist[j]
    return max(maxVal - minVal, maxLoss(pricelist[0:maxIndex]))


class TestMaxLoss(unittest.TestCase):

    def test_localpeaks(self):
        self.assertEqual(maxLoss([5,2,4,1,100,99,98,99]), 4)   
        
    def test_ascending(self):
        self.assertEqual(maxLoss([1,2,3,4,5]), 0)
        
    def test_descending(self):   
        self.assertEqual(maxLoss([5,4,3,2,1]), 4)
        
    def test_empty(self):
        self.assertEqual(maxLoss([]), 0)
        
    def test_big(self):
        self.assertEqual(maxLoss(aBigList), 99)
        
    def test_equal(self):    
        self.assertEqual(maxLoss([10,10,10,10,10]), 0)
        
